import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from "react-router-dom";

export default function Third() {
    const [data, setData] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        axios.get('http://localhost:8070/router/get/team,date') // Replace 'your_id_here' with actual ID or change this to fetch all records
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    return (
        <div>
            <h1>Search Results</h1>
            <ul>
                {data.map(item => (
                    <li key={item._id}>
                      {item.team} - {item.date} - {item.Operatorname} - {item.Operatorgrade} - {item.Operationname} - {item.Operationgrade} - {item.value} - {item.pieces}
                      </li>
                ))}
            </ul>
            <button type="button" onClick={() => navigate('/Update')}>Update</button> <br/>
            <button type="button" >Delete</button>

        </div>
    );
}
